// Navbar.js
import React from 'react';
import {useHistory} from "react-router-dom";





function Navbar2() {
  let history = useHistory();
  
  return (
    <nav>
      <button onClick={() =>{
        history.push("/createdeal");
      }}>Create Deal +</button>
    </nav>
  );
}

export default Navbar2;
